INSERT INTO `animal` VALUES (1,'송송이','툰드라 지방에서 온 여우로 흰 털이 매력적인 정령입니다'),(2,'불불이','이름처럼 불같은 성격을 가진 소 정령입니다'),(3,'핑구','뒤뚱뒤뚱 귀엽게 걷는 것이 장기인 펭귄 정령입니다'),(4,'당당이','당근을 좋아하는 순록 정령으로 멋진 뿔을 가지고 있습니다'),(5,'은빛이','은빛 날개가 아주 예쁜 올빼미정령입니다'),(6,'코코','새하얀 몸을 가진 장난 치는 것을 좋아하는 족제비 정령입니다'),(7,'뚜이','무리 생활을 통해 가족을 소중히 지키는 버팔로 정령입니다'),(8,'삐약이','작은 병아리 정령으로 누구에게나 사랑받는 귀여움을 가집니다'),(9,'밀키','분홍색 코가 매력적이며 얼룩진 모습이 귀여운 젖소 정령입니다'),(10,'동키','큰 귀와 길쭉한 몸을 가진 당근을 아주 좋아하는 당나귀 정령입니다'),(11,'꽥꽥이','언제나 하늘을 날고 싶어하는 귀여운 오리 정령입니다'),(12,'토실이','둥글고 매끄러운 몸을 가진  토실토실 돼지 정령입니다'),(13,'잠잠이','흰 털로 몸이 가득 덮힌 양 정령으로 귀여운 귀가 특징입니다'),(14,'이글이','멋지게 날고 싶은 아기 독수리 정령으로 사실은 날지 못합니다'),(15,'뽀리','영리한 여우 정령으로 늘 구슬을 찾아 여행을 떠납니다'),(16,'쿤쿤이','먼 나라 미국에서 온 라쿤 정령으로 귀여운 꼬리가 특징입니다'),(17,'아웅','카리스마가 넘치는 늑대 정령으로 언제나 듬직한 친구입니다'),(18,'냥이','줄무늬가 귀여운 고양이 정령으로 수염을 늘 정갈하게 정리해놓습니다'),(19,'멍이','노란색을 띈 귀여운 강아지 정령으로 짧은 다리가 인상적입니다'),(20,'콩이','분홍색 토끼 정령으로 늘 경주 할 거북이를 찾아 떠납니다'),(21,'느림이','귀여운 거북이 정령으로 매일 찾아오는 콩이가 귀찮기만 합니다'),(22,'똘이','날렵한 치타 정령으로 길쭉한 몸과 점박이가 특징입니다'),(23,'뿌우','작고 귀여운 코끼리 정령으로 멋진 상아를 가지고 있습니다'),(24,'피치','목이 긴 플라밍고 정령으로 호기심이 많아 언제나 두리번거립니다'),(25,'루루','우아한 가젤 정령으로 무리를 지어 달리기를 하는 것을 좋아합니다'),(26,'뽀니','장난기 가득한 얼룩말 정령으로 친구들하는 달리기 시합을 좋아합니다'),(27,'혼혼이','멋진 뿔을 가지고 있는 빅혼 정령으로 당당이를 좋아합니다'),(28,'봉울이','혹을 가지고 있는 낙타 정령으로 혹에는 항상 간식을 두고 다닙니다'),(29,'갸루','작은 캥거루 정령으로 폴짝 뛰어다니는 것을 참 좋아합니다'),(30,'코비','나무에 늘 매달려 있는 코알라 정령으로 만사가 귀찮습니다'),(31,'리링','주걱같은 입을 가진 오리너구리 정령으로 언제나 땅을 파며 다닙니다'),(32,'푸바오','인기있는 판다 정령으로 사람들을 매우 좋아한답니다'),(33,'콕콕이','멋진 꼬리를 가진 공작 정령으로 날개로 멋짐을 자랑한답니다'),(34,'라코코','이빨이 귀여운 악어 정령으로 수영을 좋아합니다'),(35,'쪼쪼','몸이 흰 백조 정령으로 얼굴에는 늘 검은 마스크를 쓰고 있습니다'),(36,'라이농','듬직한 코뿔소 정령으로 우람한 몸과 달리 속은 굉장히 소심하답니다');
/*!40000 ALTER TABLE `animal` ENABLE KEYS */;
