/*!50003 CREATE*/ /*!50017 DEFINER=`adminasrai`@`%`*/ /*!50003 TRIGGER `zoosum`.`user_AFTER_INSERT` AFTER INSERT ON `user` FOR EACH ROW
BEGIN
INSERT INTO `zoosum`.`user_badge` (user_id, badge_id)
SELECT u.user_id, b.badge_id
FROM `zoosum`.`user` as u, `zoosum`.`badge` as b
WHERE u.user_id = NEW.user_id;
INSERT INTO `zoosum`.`user_plog_info` (user_id)
SELECT u.user_id
FROM `zoosum`.`user` as u
WHERE u.user_id = NEW.user_id;
END */;;
